# Takes as input a value for k (0, 1 or 2) and a time t. Returns corresponding Error
def E_np(k, t):

	# E4 = np.sqrt(t) * H_Ising
	# adding the effect of an electromagnatic wave (passing by) 
	E4 = e/10 * np.sqrt(t) * electromagnetic_wave
	# adding S_y
	E3 = np.multiply(np.sqrt(t), spintotaly_np)
	E2 = np.multiply(np.sqrt(t), spintotalz_np)   
	E1 = np.multiply(np.sqrt(t), spintotalx_np)  
	E0 = np.identity(8)   - (np.dot(E1, E1) / 2) - (np.dot(E2, E2) / 2) - (np.dot(E3, E3) / 2) - (np.dot(E4, E4) / 2) 
	# -  (t * 1.j * H_Ising_t)
	

	


	if k == 4:
		return E4
	if k == 3:
		return E3
	if k == 2:
		return E2 
	if k == 1:
		return E1 
	if k == 0:
		return E0 


# Calculate the Gell-Mann matrices for n dimensions. Returns a lis of all matrices
def Gell_Mann(n):
	gellmann = []
	gellmann.append(Qobj(1 / (np.sqrt(n)) * identity(n), [[2, 2], [2, 2]]))
	for k in range (1, n):
		A = np.zeros((n, n), dtype=np.complex)
		for j in range (0, n):
			M = np.zeros((n, n), dtype=np.complex)
			if j < k:	
				M[k][j] = 1 / (np.sqrt(2))
				M[j][k] = 1 / (np.sqrt(2))
				gellmann.append(Qobj(M, [[2, 2], [2, 2]]))
				M[k][j] = 1j / (np.sqrt(2))
				M[j][k] = -1j / (np.sqrt(2))
				gellmann.append(Qobj(M, [[2, 2], [2, 2]]))
				A[j][j] =  np.sqrt(1 / (k * (k + 1)))
		A[k][k] =  -k * np.sqrt(1 / (k * (k + 1)))
		gellmann.append(Qobj(A, [[2, 2], [2, 2]]))
	return gellmann


